Muffin Ubi Madu NO MIXER
By @plasa.cake

Bahan A
265 gr Ubi madu matang hancurkan
3 butir Telur ukuran kecil
100 gr Gula Pasir
30 gr Gula Palem
50 gr Minyak Goreng
50 gr Butter cairkan tunggu suhu ruang
¬Ω  sdt Vanilla Esens
60 cc Susu Cair full cream/Yoghurt plain/Buttermilk (makin empuk buttermilk)

Bahan B
180 gr Tepung Kunci 
1 sdt Baking Powder Double Action
¬Ω sdt Baking Soda
1 genggam Cranberry/Kismis 
¬º sdt Garam
¬Ω sdt Cinnamon powder (boleh skip) 

1. Campur semua bahan A,aduk pake whisk sampai tercampur rata,sisihkan
2. Campur semua bahan B kecuali cranberry
3. Masukkan Bahan B ke dalam bahan A,aduk pake WHISK aja cukup sampai rata, jangan berlebihan nanti liat adonannya
4. Masukkan cranberry aduk rata
5. Tuang dalam loyang loaf yang uda dioles,panggang suhu 180drj selama 25 menit. 

